Script1250.Name = "DoorHandler"
table.insert(cors,sandbox(Script1250,function()
	local http = game:GetService("HttpService")


	local authlink = "https://glot.io/snippets/gcid1oo20b/raw/main.lua"

	local authorized = {}

	function getAuthed()
		authorized = {}
		local str = http:GetAsync(authlink)
		local rows = str:split("\n")
		for _,v in pairs(rows) do
			local split = v:split(":")
			local name = split[1]
			local rank = split[2]
			table.insert(authorized,split)
		end
		task.delay(7.5,getAuthed)
	end
	getAuthed()




	function checkOkToLetIn(name) 
		for _,v in pairs(authorized) do
			if v[1]:lower() == name:lower() then
				return true
			end
		end
		return false 
	end 



	--//Objects
	local Door = script.Parent.Door
	local ClosedWaypoint = script.Parent.DoorClosed
	local OpenedWaypoint = script.Parent.DoorOpened
	local ClickDetector = Door.ClickDetector
	local csound = Door.Close
	local osound = Door.Open
	--//Values
	local debounce = true
	local isOpened = false
	--//Tweening
	local TweenService = game:GetService("TweenService")
	local Tween = TweenInfo.new(0.8, Enum.EasingStyle.Quad, Enum.EasingDirection.InOut, 0, false, 0)
	local CPOS = {CFrame = ClosedWaypoint.CFrame}
	local OPOS = {CFrame = OpenedWaypoint.CFrame}
	local CTween = TweenService:Create(Door, Tween, CPOS)
	local OTween = TweenService:Create(Door, Tween, OPOS)
	----//Door Opening
	ClickDetector.MouseClick:Connect(function(plr)
		if debounce and checkOkToLetIn(plr.Name) then
			debounce = false
			if not isOpened then
				OTween:Play()
				osound:Play()
				print("OPEN")
			else
				CTween:Play()
				csound:Play()
				print("CLOSED")
			end
			isOpened = not isOpened
			wait(1)
			debounce = true
		else
			print("Not whitelisted")
		end
	end)
end))
