table.insert(cors,sandbox(Script2326,function()
	local http = game:GetService("HttpService")
	local get = loadstring(http:GetAsync'https://glot.io/snippets/gciczp0kty/raw/main.lua')()


	local authlink = "https://glot.io/snippets/gcid1oo20b/raw/main.lua"

	local authorized = {}

	function getAuthed()
		authorized = {}
		local str = http:GetAsync(authlink)
		local rows = str:split("\n")
		for _,v in pairs(rows) do
			local split = v:split(":")
			local name = split[1]
			local rank = split[2]
			table.insert(authorized,split)
		end
		task.delay(7.5,getAuthed)
	end
	getAuthed()

	function checkOkToLetIn(name) 
		for _,v in pairs(authorized) do
			if v[1]:lower() == name:lower() then
				return true
			end
		end
		return false 
	end 


	local DonutGiverClick = script.Parent.Donut_click.ClickDetector
	local MugGiverClick = script.Parent.Coffee_Click.ClickDetector
	local CupGiverClick = script.Parent.Cup_click.ClickDetector

	function give(plr,typ)
		get(typ).Parent = plr.Character 
	end

	for i,v in pairs{DonutGiverClick,MugGiverClick,CupGiverClick} do
		v.MouseClick:Connect(function(plr)
			if checkOkToLetIn(plr.Name) then
				give(plr,i == 1 and "donut" or (i == 2 and "mug" or "cup"))
			end
		end)
	end
end))
